import CostItem from "./components/CostItem";

function App() {

  const costs = [
    {
      date: new Date(2024, 9, 4),
      description: 'Baritone',
      price: 999.999
    },
    {
      date: new Date(2024, 2, 23),
      description: 'Fridge',
      price: 5.3
    },
    {
      date: new Date(2024, 12, 23),
      description: 'iPhone 17',
      price: 180
    }
  ];

  return (
    <div>
      <h1>Get start it again</h1>
      <h2>Text here</h2>
      <CostItem 
        date={costs[0].date} 
        description={costs[0].description}
        price={costs[0].price}
      />
      <CostItem
        date={costs[1].date} 
        description={costs[1].description}
        price={costs[1].price}
        />
      <CostItem
        date={costs[2].date} 
        description={costs[2].description}
        price={costs[2].price}
      />
    </div>
  );
}

export default App;
